import React from "react";
import "../App.css";
import Header from "../component/Header";
import RESULT from "../content/RESULT";
import Final_TYPE from "../content/FinalTYPE";
import NextButton from "../component/NextButton";
import QNA from "../content/QNA";
import Graph from "../component/Graph";
import CircularBar from "../component/CircularBar";

const Result = RESULT;
const Final_Type = Final_TYPE;

function Final_Result(props) {
  const Res = props.location.state.Res;
  console.log(Res);

  function formula_Index(Score) {
    const Index =
      Score >= 100
        ? 4 - parseInt(99 / 25)
        : Score < 0
        ? 4 - parseInt(1 / 25)
        : 4 - parseInt(Score / 25);
    console.log("******formula_Index", Score, Index);

    return Index;
  }

  //Type: PERIOD, PURPOSE, TOLERANCE, LITERACY, EXPERIENCE
  function find_ResultData(Type, Index) {
    console.log("******find_ResultData", Type, Index);
    return RESULT[Type][RESULT[Type].findIndex((data) => data.Index === Index)];
  }

  function getScore(questionID) {
    const Tdata = ASCORE[ASCORE.findIndex((data) => data.id === questionID)];
    if (Tdata.Type === "Single") {
      return Tdata.Answer[
        Tdata.Answer.findIndex((d) => d.id === Res[questionID])
      ].Score;
    } else if (Tdata.Type === "Multi") {
      console.log(Tdata, Res[questionID]);
      let Score = 0;

      for (let i = 0; i < Res[questionID].length; i++) {
        Score =
          Score +
          Tdata.Answer[
            Tdata.Answer.findIndex((d) => d.id === Res[questionID][i])
          ].Score;
      }
      return Score;
    }
  }

  const PERIOD = find_ResultData("PERIOD", getScore(1));
  const PURPOSE = find_ResultData("PURPOSE", formula_Index((getScore(2)+getScore(7))/2));


  function SetPeriod() {
    //íˆ¬ì ê¸°ê°„ Index ì„¸íŒ…
    const idx =
      Per_Quest === 5
        ? 0
        : Per_Quest === 4
        ? 1
        : Per_Quest === 3
        ? 2
        : Per_Quest === 2
        ? 3
        : Per_Quest === 1
        ? 4
        : console.log("No Result");
    console.log("íˆ¬ì ê¸°ê°„ ì‘ë‹µ: ", Per_Quest, "\níˆ¬ì ê¸°ê°„ Index: ", idx);
    return idx;
  }
  function SetPurpose() {
    //íˆ¬ì ëª©ì  Index ì„¸íŒ…
    const idx =
      Purpose >= 26
        ? 0
        : 16 <= Purpose && Purpose < 26
        ? 1
        : 6 <= Purpose && Purpose < 16
        ? 2
        : Purpose < 6
        ? 3
        : console.log("No Result");
    console.log("íˆ¬ì ëª©ì  ì‘ë‹µ: ", Purpose, "\níˆ¬ì ëª©ì  Index: ", idx);
    return idx;
  }
  function SetTolerance() {
    //ìœ„í—˜ ê°ë‚´ë„ Index ì„¸íŒ…
    const idx =
      Tolerance >= 26
        ? 0
        : 16 <= Tolerance && Tolerance < 26
        ? 1
        : 6 <= Tolerance && Tolerance < 16
        ? 2
        : Tolerance < 6
        ? 3
        : console.log("No Result");
    console.log("ìœ„í—˜ ê°ë‚´ë„ ì‘ë‹µ: ", Tolerance, "\nìœ„í—˜ ê°ë‚´ë„ Index: ", idx);
    return idx;
  }
  function SetLiteracy() {
    //ê¸ˆìœµ ì´í•´ë„ Index ì„¸íŒ…
    const idx =
      Literacy >= 8 ? 0
        : 6 <= Literacy && Literacy < 8 ? 1
        : 3 <= Literacy && Literacy < 6 ? 2
        : Literacy < 3 ? 3
        : console.log("No Result");
    console.log("ê¸ˆìœµ ì´í•´ë„ ì‘ë‹µ: ", Literacy, "\nê¸ˆìœµ ì´í•´ë„ Index: ", idx);
    return idx;
  }
  function SetExperience() {
    //íˆ¬ì ê²½í—˜ Index ì„¸íŒ…
    const idx =
      Experience >= 31 ? 0
        : 21 <= Experience && Experience < 31 ? 1
        : 11 <= Experience && Experience < 21 ? 2
        : Experience < 11 ? 3
        : console.log("No Result");

    console.log("íˆ¬ì ê²½í—˜ ì‘ë‹µ: ", Experience, "\níˆ¬ì ê²½í—˜ Index: ", idx);
    return idx;
  }

  const Res_Period = Result.íˆ¬ìê¸°ê°„[SetPeriod()];
  const Res_Purpose = Result.íˆ¬ìëª©ì [SetPurpose()];
  const Res_Tolerance = Result.ìœ„í—˜ê°ë‚´ìˆ˜ì¤€[SetTolerance()];
  const Res_Literacy = Result.ê¸ˆìœµì´í•´ë„[SetLiteracy()];
  const Res_Experience = Result.íˆ¬ìê²½í—˜[SetExperience()];

  //í† íƒˆ ì ìˆ˜ ê³„ì‚°
  const Total_Score =
    Res_Purpose.Value +
    Res_Tolerance.Value +
    Res_Literacy.Value +
    Res_Experience.Value +
    Period +
    Age.Value +
    Income.Value +
    Property.Value;

  //íˆ¬ì ì„±í–¥ ì ìˆ˜ ê³„ì‚°
  const Score =
    Res_Purpose.Value +
    Res_Tolerance.Value +
    Res_Literacy.Value +
    Res_Experience.Value;

  //íˆ¬ì ì„±í–¥ ìºë¦­í„° Index ì„¸íŒ…
  function SetType() {
    console.log("Total Score is... ", Total_Score, "\nScore is... ", Score);
    const idx =
      Total_Score >= 31 && 16 <= Score <= 18 ? 0
        : Total_Score >= 31 && 14 <= Score && Score <= 15 ? 1
        : Total_Score >= 31 && 12 <= Score && Score <= 13 ? 2
        : 23 <= Total_Score && Total_Score <= 30 && 14 <= Score && Score <= 18 ? 3
        : 23 <= Total_Score && Total_Score <= 30 && 12 <= Score && Score <= 13 ? 4
        : 23 <= Total_Score && Total_Score <= 30 && 7 <= Score && Score <= 11 ? 5
        : 18 <= Total_Score && Total_Score <= 22 && 14 <= Score && Score <= 18 ? 6
        : 18 <= Total_Score && Total_Score <= 22 && 12 <= Score && Score <= 13 ? 7
        : 18 <= Total_Score && Total_Score <= 22 && 7 <= Score && Score <= 11 ? 8
        : 6 <= Total_Score && Total_Score <= 17 && Score === 13 ? 9
        : 6 <= Total_Score && Total_Score <= 17 && 11 <= Score && Score <= 12 ? 10
        : 6 <= Total_Score && Total_Score <= 17 && 7 <= Score && Score <= 10 ? 11
        : Total_Score <= 5 ? 12
        : console.log("Error Type");
    return idx;
  }

  const Type = Final_Type[SetType()];

  const MIN = Type.Min;
  const MAX = Type.Max;
  const REV = Type.Revenue;

  return (
    <div className="App">
      <Header history={props.history} />
      <div className="Result">
        <div>
          <div>
            <div className="Quest">
              <div
                style={{
                  fontSize: "20px",
                  fontWeight: "700",
                  fontFamily: "DungGeunMo",
                }}
              >
                Quest
              </div>
              <div>{Res_Period.Quest}</div>
            </div>
            {/* <img className='TypeImage'></img> */}
            <div className="TypeImage"></div>
            <h1
              style={{
                color: "#fefefe",
